body.crudDataFilter:
crud.api = {
  "url": "${context.rootUrl}/service/api/organizations/root",
  "method": "get",
  "headers": {
    "Authorization": "Bearer ${context.tenantId},${context.authToken}"
  },
  "requestAdaptor": "return Steedos.organizationsTree.getApiRequestAdaptor(api, context, { isLookup: false });",
  "adaptor": "return Steedos.organizationsTree.getApiAdaptor(payload, response, api, context, { isLookup: false });"
};
return crud;
